import React from "react";

const MainScreen = () => {
  // 메뉴 클릭 핸들러
  const handleMenuClick = (menuName) => {
    console.log(`${menuName} 메뉴가 클릭되었습니다`);
    // 여기에 페이지 이동 로직 추가 가능
  };

  return (
    <div
      className="flex flex-col h-screen w-full bg-gray-50 overflow-y-auto"
      style={{ fontFamily: "'산돌광수체', 'YoonSSH', sans-serif" }}
    >
      {/* 상단 헤더 */}
      <header
        className="flex justify-between items-center p-3 w-full"
        style={{ backgroundColor: "#B7F3FF" }}
      >
        <div>
          <img
            src={require("../assets/images/logo.png")}
            alt="빨랑 빨래 로고"
            className="h-16"
          />
        </div>
        <div className="text-xl">
          <span className="cursor-pointer">회원가입</span>
          <span className="mx-2">|</span>
          <span className="cursor-pointer">로그인</span>
        </div>
      </header>

      {/* 메인 콘텐츠 */}
      <div className="flex flex-col items-center flex-none">
        <div className="w-full relative">
          <div className="w-full">
            <img
              src={require("../assets/images/mainbanner.png")}
              alt="얼룩 옷을 들고 있는 여성"
              className="w-full h-auto block"
            />
          </div>
        </div>
      </div>

      {/* 하단 메뉴 */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-3 p-3 bg-gray-50 flex-1">
        <div
          className="flex flex-col items-center justify-center rounded-full p-4 text-center aspect-square relative cursor-pointer"
          onClick={() => handleMenuClick("분석하기")}
          style={{ backgroundColor: "#B7F3FF" }}
        >
          <p className="m-0 font-bold text-base z-10">분석하기</p>
          <span className="text-xs text-gray-700 z-10 mt-1 px-1 leading-tight">
            사진을 찍어 얼룩의 유형을 분석해보세요
          </span>
        </div>
        <div
          className="flex flex-col items-center justify-center rounded-full p-4 text-center aspect-square relative cursor-pointer"
          onClick={() => handleMenuClick("분석내역")}
          style={{ backgroundColor: "#B7F3FF" }}
        >
          <p className="m-0 font-bold text-base z-10">분석내역</p>
          <span className="text-xs text-gray-700 z-10 mt-1 px-1 leading-tight">
            이전에 분석한 내용을 다시 확인하세요
          </span>
        </div>
        <div
          className="flex flex-col items-center justify-center rounded-full p-4 text-center aspect-square relative cursor-pointer"
          onClick={() => handleMenuClick("유지관리")}
          style={{ backgroundColor: "#B7F3FF" }}
        >
          <p className="m-0 font-bold text-base z-10">유지관리</p>
          <span className="text-xs text-gray-700 z-10 mt-1 px-1 leading-tight">
            의류에는 환경과 성분보존을 위한 방법이 있어요
          </span>
        </div>
        <div
          className="flex flex-col items-center justify-center rounded-full p-4 text-center aspect-square relative cursor-pointer"
          onClick={() => handleMenuClick("근처 세탁소")}
          style={{ backgroundColor: "#B7F3FF" }}
        >
          <p className="m-0 font-bold text-base z-10">근처 세탁소</p>
          <span className="text-xs text-gray-700 z-10 mt-1 px-1 leading-tight">
            가장 가까운 위치의 세탁소를 찾아보세요
          </span>
        </div>
      </div>
    </div>
  );
};

export default MainScreen;
